import React from "react";
import TodoItem from "./TodoItem";
import "./TodoList.css";

const TodoList = ({ todos, onDel, onToggle }) => {
  return (
    <ul className="TodoList">
      <h2>To Do</h2>
      {todos.map((todos) => (
        <TodoItem
          key={todos.id}
          todos={todos}
          onDel={onDel}
          onToggle={onToggle}
        />
      ))}
    </ul>
  );
};

export default TodoList;
